window.bookSummaryJSON = "<p><b><i>New York Times</i></b><b> Best Seller</b></p> <p><b>Witness the epic final chapter of the Skywalker saga with the official novelization of </b><b><i>Star Wars: The Rise of Skywalker</i></b><b>, including expanded scenes and additional content not seen in theaters!</b></p> <p>The Resistance has been reborn. But although Rey and her fellow heroes are back in the fight, the war against the First Order, now led by Supreme Leader Kylo Ren, is far from over. Just as the spark of rebellion is rekindling, a mysterious signal broadcasts throughout the galaxy, with a chilling message: Emperor Palpatine, long thought defeated and destroyed, is back from the dead.</p> <p>Has the ancient Lord of the Sith truly returned? Kylo Ren cuts a swath of destruction across the stars, determined to discover any challenge to his control over the First Order and his destiny to rule over the galaxy - and crush it completely. Meanwhile, to discover the truth, Rey, Finn, Poe, and the Resistance must embark on the most perilous adventure they have ever faced.</p> <p>Featuring all-new scenes adapted from never-before-seen material, deleted scenes, and input from the filmmakers, the story that began in <i>Star Wars: The Force Awakens</i> and continued in <i>Star Wars: The Last Jedi</i> reaches an astounding conclusion.</p>"; 
